DROP TABLE IF EXISTS `droplist`;
CREATE TABLE `droplist` (
  `mobId` int(11) unsigned NOT NULL default '0',
  `itemId` int(11) unsigned NOT NULL default '0',
  `min` int(11) unsigned NOT NULL default '0',
  `max` int(11) unsigned NOT NULL default '0',
  `sweep` int(1) unsigned NOT NULL default '0',
  `chance` int(11) unsigned NOT NULL default '0',
  `category` tinyint(3) unsigned NOT NULL default '0',
  PRIMARY KEY  (`mobId`,`itemId`,`sweep`,`category`),
  KEY `key_itemId` (`itemId`),
  KEY `key_mobId` (`mobId`)
) ENGINE=MyISAM;

